import { faCalendar, faLocation } from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import React from 'react'
import styled from 'styled-components'

const Container = styled.section`
    margin-top: 5em;
    padding-top: 1em;
    padding-left: 5em;

    h1{
        font-family: "Ruberoid";
        font-size: 7em;
        margin-bottom: 0;
        padding-bottom: 0;
    }
`

const SubTitle = styled.p`
    font-family: "Ruberoid";
    margin: 0;
    padding: 0;
`

function Events() {
  return (
    <Container>
        <h1>Events</h1>
        <p>Hangout with the Celestia community IRL or online.</p>

        <div>
            <img/>
            <div>
                <div>
                    <h3>Celestia hackathon</h3>
                    <div>
                        <p><FontAwesomeIcon icon={faCalendar}/> Coming soon!</p>
                        <p><FontAwesomeIcon icon={faLocation}/> Online</p>
                    </div>
                </div>

                <button>View event</button>
            </div>
        </div>

        <div>
            <div>
                <h3>Community events</h3>
                <button>Submit your Event</button>
            </div>

            <div>View Past Events</div>
        </div>
    </Container>
  )
}

export default Events
